import './styles.css';
import logo from '../../assets/Logo_Xoping.png'

const Sidebar = () =>

    <div className="Sidebar">
        <img src = {logo} alt="Xoping Logo"></img>
        <div className="lista">Lista de compras</div>
        <div className="historico">Histórico</div>
        <div className="config">Configurações</div>
        <div className="exit">Sair</div>

    </div>
    ;



export default Sidebar;
